import React from "react"

function ManageDetailsView(props) {

    return (
        <div>
            <table className="table">
                <thead>
                    <tr>
                        <th>&nbsp;</th>
                        <th>Name</th>
                        <th>Address</th>
                        <th>Category</th>
                    </tr>
                </thead>
                <tbody>
                    <tr key="1">
                        {
                            Object.keys(props.details).forEach(priKey => {
                                if (!Number.isInteger(parseInt(priKey, 10))) {
                                    return (
                                        <tr key={priKey}>
                                            if (typeof props.details[priKey] === 'object') {
                                                Object.keys(props.details[priKey]).forEach(secKey => {
                                                    if (!Number.isInteger(parseInt(secKey, 10))) {
                                                        return (
                                                            <tr>
                                                                <td>He{secKey}</td>
                                                                <td>{props.details[priKey][secKey]}</td>
                                                            </tr>
                                                        )
                                                        // console.log(`key: ${secKey}, value: ${props.details[priKey][secKey]}`)
                                                    }
                                                }
                                                )
                                            }
                                            else {
                                                //     return (
                                                //         <tr>
                                                //     <td>He{priKey}</td>
                                                //     <td>{props.details[priKey]}</td>
                                                // </tr>
                                                // )
                                                console.log(`key: ${priKey}, value: ${props.details[priKey]}`)
                                            }
                                            <td>

                                            </td>
                                        </tr>
                                    )
                                }
                            })
                        }
                    </tr>
                </tbody>
            </table>
        </div>
    )
}

export default ManageDetailsView;
